export const User = (props) => {
    return(
        <div>
            {/*<div> {props.status} {props.city} {props.county} {props.id}</div>*/}
            <span>
                <div>
                    <img src="" alt=""/>
                </div>
                <div>
                    <button>FOLLOW</button>
                </div>
            </span>
            <span>
                <span>
                    <div>{props.fullName}</div>
                    <div>{props.status}</div>
                </span>
                <span>
                    {props.county}
                    {props.city}
                </span>
            </span>
        </div>
    );
}
